on el nombre de framboyán azul, una especie brasileña empleada como ornamental, la Jacaranda filicifolia D. Don, cuyas hojas se usan en Colombia, donde la llaman gualanday, para curar las afecciones sifilíticas. La raíz es diaforética y la corteza emetocátartica. 82 A Otra especie de bignoniácea, cultivada como ornamental por sus bellas flores rojas, es la espatodea, Spathodea campanulata Beauv., cuya corteza se emplea en Colombia como astringente para combatir la diarrea y la disentería. Se dice que el agua contenida en sus botones florales es tónica. A esta planta la llaman en Colombia tulipán rojo.\",\"Cul\":\"\",\"Bib\":[\"Pérez Arbelaez, Enrique: Plantas medicinales y venenosas de Colombia, pp. 257-258, 1937.\"]}"
